const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  const Header = () =>{
    return (
      <div>
        <h1>{course}</h1>
      </div>
    )
  }

  const Content = () => {
      return (
        <div>
          <Part course={part1} ex={exercises1}/>
          <Part course={part2} ex={exercises2}/>
          <Part course={part3} ex={exercises3}/>
        </div>
      )
  }

  const Part = (props) => {
    return (
      <div>
        <p>{props.course} {props.ex}</p>
      </div>
    )
  }

  const Total = () => {
    return (
      <div>
        <p>{exercises1 + exercises2 + exercises3}</p>
      </div>
    )
  }

  return (
    <div>
      <Header />
      <Content />
      <Total />
    </div>
  )
}

export default App
